"use strict";document.addEventListener("DOMContentLoaded",(function(){const t=document.getElementById("logoutLink");t&&t.addEventListener("click",(function(t){t.preventDefault(),fetch("{% url 'auth_logout' %}",{method:"POST",headers:{"X-CSRFToken":"{{ csrf_token }}"}}).then((t=>{t.ok?window.location.reload():window.location.href="/"})).catch((()=>{window.location.href="/"}))}))}));